import React, { useState, useEffect } from "react";
import { View, Text, FlatList, Dimensions } from "react-native";
import { fontPixel, pixelSizeVertical } from "../../lib/style/adjust";
import { useStyles } from "../../lib/style/useStyle";
import { useSafeAreaInsets } from "react-native-safe-area-context";
import FocusAwareStatusBar from "../../Components/common/FocusAwareStatusBar";
import auth from "../../lib/api/auth";
import { Pressable } from "react-native";
import PixelImage from "../../Components/common/PixelImage";
import { pixelSizeHorizontal } from "../../lib/style/adjust";
import { widthPixel, heightPixel } from "../../lib/style/adjust";
import { ScrollView } from "react-native-gesture-handler";
import RenderHTML from "react-native-render-html";

const { width, height } = Dimensions.get("window");

const showAllQuestions = ({ navigation }) => {
    const [questionData, setQuestionData] = useState([]);
    const [comment, setComment] = useState([]);

    const getUserData = async () => {
        const response = await auth.post("user/showAllQuestions");
        console.log(response.data.comments);
        setQuestionData(response.data);
    };

    useEffect(() => {
        getUserData();
    }, []);

    const commonStyle = useStyles();
    const insets = useSafeAreaInsets();

    const goodsList = [
        {
            id: 1,
            name: "DNA Test",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods1.png"),
        },
        {
            id: 2,
            name: "DNA Test",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods1.png"),
        },
        {
            id: 3,
            name: "DNA Test",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods1.png"),
        },
    ];
    const goodsList1 = [
        {
            id: 1,
            type: "supplement",
            name: "Vitamin D",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods2.png"),
        },
        {
            id: 2,
            type: "supplement",
            name: "Vitamin D",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods2.png"),
        },
        {
            id: 3,
            type: "supplement",
            name: "Vitamin D",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods2.png"),
        },
    ];
    const goodsList2 = [
        {
            id: 1,
            type: "hormone shot",
            name: "Lorem ipsum",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods3.png"),
        },
        {
            id: 2,
            type: "hormone shot",
            name: "Lorem ipsum",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods3.png"),
        },
        {
            id: 3,
            type: "hormone shot",
            name: "Lorem ipsum",
            price: 195,
            imageUrl: require("../../assets/images/shop/goods3.png"),
        },
    ];

    // const renderItem = ({ item, index }) => <OrderGoods item={item} />;

    return (
        <View
            style={{
                padding: 10,
                backgroundColor: "#FFFFFF",
            }}
        >
            <View style={{ margin: pixelSizeVertical(20) }}>
                <Text
                    style={
                        {
                            color: "#29406C",
                            letterSpacing: 1,
                            fontSize: fontPixel(30),
                            fontWeight: "800",
                            textAlign: "center",
                        }
                    }
                >
                    All Questions
                </Text>
            </View>
            <View
                style={{
                    display: "flex",
                    marginBottom: 120,
                }}
            >
                <ScrollView showsVerticalScrollIndicator={false}>
                    {questionData.map((question, index) => (
                        <View
                            key={index}
                            style={{
                                borderColor: "#244e78",
                                borderWidth: 1,
                                margin: 10,
                                padding: 5,
                                borderRadius: 5,
                            }}
                        >
                            <View>
                                <View
                                    style={{ flexDirection: "column", width: "50%", margin: 5 }}
                                >
                                    <Text
                                        style={
                                            {
                                                fontSize: fontPixel(24),
                                                fontWeight: "bold",
                                                letterSpacing: pixelSizeHorizontal(1),
                                            }
                                        }
                                    >
                                        Title:
                                    </Text>

                                    <Text
                                        style={
                                            {
                                                fontSize: fontPixel(15),
                                                fontWeight: "bold",
                                                letterSpacing: pixelSizeHorizontal(1),
                                                top: "15%",
                                            }
                                        }
                                    >
                                        {/* {question.title} */}
                                        <RenderHTML source={{ html: question?.title }} />
                                    </Text>
                                </View>
                                <View
                                    style={{
                                        width: "50%",
                                        flexDirection: "column",
                                        justifyContent: "space-between",
                                        marginBottom: 20,
                                        margin: 5,
                                    }}
                                >
                                    <Text
                                        style={
                                            {
                                                fontSize: fontPixel(24),
                                                fontWeight: "bold",
                                                letterSpacing: pixelSizeHorizontal(1),
                                            }
                                        }
                                    >
                                        Description:
                                    </Text>
                                    <Text
                                        style={
                                            {
                                                color: "#FFFFFF",
                                                fontSize: fontPixel(14),
                                                fontWeight: "bold",
                                            }
                                        }
                                    >
                                        {/* {question.description} */}
                                        <RenderHTML source={{ html: question?.description }} />
                                    </Text>

                                </View>
                                <View
                                    style={{
                                        alignSelf: "flex-end",
                                        backgroundColor: "rgba(255, 255, 255, 0.1)",
                                    }}
                                />
                                <Pressable
                                    style={{
                                        backgroundColor: '#244e78',
                                        width: '50%',
                                        alignSelf: 'center'
                                    }}
                                    onPress={() => {
                                        navigation.navigate('AnswerQuestion', { questionId: question._id })
                                    }}>
                                    <Text style={{
                                        color: '#FFFFFF',
                                        padding: 10,
                                        textAlign: 'center',
                                        fontWeight: '600'
                                    }}>
                                        Answer Question
                                    </Text>
                                </Pressable>
                            </View>
                        </View>
                    ))}
                </ScrollView>
            </View>
        </View>
    );
};

export default showAllQuestions;
